    name: SECTION 3.1
    sectionNumber: '3.1'
    sectionTitle: Primary Objectives
    text: "<table><tr><td style=\"vertical-align: top; text-align: left\"><p>To determine\
      \ if there is a statistically significant relationship (overall Type 1 erroralpha=0.05)\
      \ between the change in both the ADAS-Cog (11) and CIBIC+ scores, and drug dose\
      \ (0, 50 cm2 [54 mg], and 75 cm2 [81 mg]).</p></td><td style=\"vertical-align:\
      \ top; text-align: left\"><p>Alzheimer's Disease Assessment Scale - Cognitive\
      \ Subscale, total of 11 items [ADAS-Cog (11)] at Week 24</p><p>Video-referenced\
      \ Clinician\u2019s Interview-based Impression of Change (CIBIC+) at Week 24</p></td></tr><tr><td\
      \ style=\"vertical-align: top; text-align: left\"><p>To document the safety\
      \ profile of the xanomeline TTS.</p></td><td style=\"vertical-align: top; text-align:\
      \ left\"><p>Adverse events</p><p>Vital signs (weight, standing and supine blood\
      \ pressure, heart rate)</p><p>Laboratory evaluations (Change from Baseline)</p></td></tr><tr><td\
      \ style=\"vertical-align: top; text-align: left\"><p>To assess the dose-dependent\
      \ improvement in behavior. Improved scores on the Revised Neuropsychiatric Inventory\
      \ (NPI-X) will indicate improvement in these\nareas.</p></td><td style=\"vertical-align:\
      \ top; text-align: left\"><p>Alzheimer's Disease Assessment Scale - Cognitive\
      \ Subscale, total of 11 items [ADAS-Cog (11)] at Weeks 8 and 16</p><p>Video-referenced\
      \ Clinician\u2019s Interview-based Impression of Change (CIBIC+) at Weeks 8\
      \ and 16</p><p>Mean Revised Neuropsychiatric Inventory (NPI-X) from Week 4 to\
      \ Week 24</p></td></tr></table>"
