      attribute="description"/> as defined by the NINCDS and the ADRDA guidelines
      (Attachment LZZT.7)</p></td></tr><tr><td style="vertical-align: top; text-align:
      left"><p>3</p></td><td style="vertical-align: top; text-align: left"><p><usdm:ref
      klass="Activity" id="Activity_6" attribute="label"/> score of 10 to 23</p></td></tr></table>'
